;======== H2D 20250818========
; SKIPPABLE_START
; SKIPTYPE: timelapse
M622.1 S1 ; for prev firmware, default turned on

M1002 judge_flag timelapse_record_flag

M622 J1
M993 A2 B2 C2
M993 A0 B0 C0

{if !spiral_mode && !(has_timelapse_safe_pos && timelapse_type == 0) }
    {if most_used_physical_extruder_id!= curr_physical_extruder_id || timelapse_type == 1}
        M83
        G1 Z{max_layer_z + 0.4} F1200
        M400
    {endif}
{endif}

{if has_timelapse_safe_pos && timelapse_type == 0 && !spiral_mode}
    M9711 M{timelapse_type} E{most_used_physical_extruder_id} X{timelapse_pos_x} Y{timelapse_pos_y} Z{layer_z + 0.4} S11 C10 O0 T3000
{else}
    {if spiral_mode}
        M9711 M{timelapse_type} E{most_used_physical_extruder_id} Z{layer_z} S11 C10 O0 T3000
    {else}
        M9711 M{timelapse_type} E{most_used_physical_extruder_id} Z{layer_z + 0.4} S11 C10 O0 T3000
    {endif}
{endif}

{if !spiral_mode && !(has_timelapse_safe_pos && timelapse_type == 0) }
    {if most_used_physical_extruder_id!= curr_physical_extruder_id || timelapse_type == 1}
        G90
        G1 Z{max_layer_z + 3.0} F1200
        G1 Y295 F30000
        G1 Y265 F18000
        M83
    {endif}
{endif}
M993 A3 B3 C3

M623
; SKIPPABLE_END
